import React from 'react';
import ReactPlayer from 'react-player';

const VideoDisplay = ({url}) => (<>
    <ReactPlayer
      className='react-player'
      url={url}
      playing
      width='200%'
      height='200%'
    />
  </>)

export default VideoDisplay;
